import React, {useState} from 'react';

const useEffect2 = () => {
    const [num, setnum] = useState(0);
    useEffect(()=>{
        alert("Clicked");
    })
    
    return (
        <>
        <button onClick = {()=> {
            setnum(num+1)
        }}>Click me {num}</button>
        </>
    )

}

export default useEffect2;
